import React from 'react';
import "../styles/progress.scss"
export default function Progress ({ done }) {
   return (
      <div className="progress">
         <div
            className="progress-done"
            style={{
               opacity: 1,
               width: `${done}%`,
            }}
         ></div>
      </div>
   );
};
